////////////////////////////////////////////////////////////////////
         //FUNCIONES PARA MULTIPLICAR MATRICES A Y B//

//Multiplicacion fila-columna
int matrixMulti_rowcol(int dim, int A[dim][dim], int B[dim][dim], int C[dim][dim]){
    int i, j, k;
    for(i = 0; i < dim; i++){
        for(j = 0; j < dim; j++){
            C[i][j] = 0; //Se inicializa la matriz
            for(k = 0; k < dim; k++){
                C[i][j] += A[i][k] * B[k][j]; //Se asignan las multiplicaciones a la matriz C
            }
        }
    }
}

//Multiplicacion columna-fila
int matrixMulti_colrow(int dim, int A[dim][dim], int B[dim][dim], int C[dim][dim]){
    int i, j, k;
    for(j = 0; j < dim; j++){
        for(i = 0; i < dim; i++){
            C[i][j] = 0; //Se inicializa la matriz
            for(k = 0; k < dim; k++){
                C[i][j] += A[i][k] * B[k][j]; //Se asignan las multiplicaciones a la matriz C
            }
        }
    }
}

//Multiplicacion con punteros
int matrixMulti_pointer(int dim, int *A, int *B, int *C){
    int i, j, k;
    for(i = 0; i < dim; i++){
        for(j = 0; j < dim; j++){
            *(C + i * dim + j) = 0; //Se inicializa C con solo ceros    
        }
    }

    for(i = 0; i < dim; i++){
        for(j = 0; j < dim; j++){
            for(k = 0; k < dim; k++){
                *(C + i * dim + j) += *(A + i * dim + k) * *(B + k * dim + j);
            }
        }
    }
}

////////////////////////////////////////////////////////////////////
             //FUNCIONES PARA IMPRIMIR EN CONSOLA//

             
void print_rowcol(int dim, int C[dim][dim]){
    int i, j;
    printf("Matriz resultante de filas-columnas: \n");
    for(i = 0; i < dim; i++){
        for(j = 0; j < dim; j++){
            printf("%d ", C[i][j]);
        }
        printf("\n");
    }
}

void print_colrow(int dim, int C[dim][dim]){
    int i, j;
    printf("\nMatriz resultante de columnas-filas: \n");
    for(i = 0; i < dim; i++){
        for(j = 0; j < dim; j++){
            printf("%d ", C[i][j]);
        }
        printf("\n");
    }
}

void print_pointer(int dim, int *C){
    int i, j;
    printf("\nMatriz resultante de la multiplicacion por punteros: \n");
    for(i = 0; i < dim; i++){
        for(j = 0; j < dim; j++){
            printf("%d ", *(C + i * dim + j));
        }
        printf("\n");
    }
}

int read_rowcol(int dim, int C[dim][dim]){
    clock_t t11;
    t11 = clock();
    int rand_row = 1 + rand() % (dim - 1);
    int rand_col = 1 + rand() % (dim - 1);
    printf("\nAcceder a una posicion aleatoria de valores C[%d][%d] es: %d", 
    rand_row, rand_col, C[rand_row][rand_col]);

    t11 = clock() - t11;
    double time_taken11 = ((double)t11)/CLOCKS_PER_SEC;
    printf(" con un tiempo de %f segundos\n", time_taken11);

    return 0;
}

